import styles from './Slider.modules.css'
import photosGym from './photosGymList'
import Button from './Button'

const Slider = () => {
  console.log(photosGym.length)

  const popHandle = () => {
    return photosGym = photosGym.pop
  }

  console.log(photosGym.length)

  return (
    <div className={styles}>
      <div className="slider">
        <div className="darkSides" />
        <div className="sliderImg">
          {photosGym.map((img, index) => {
            return (
              <div key={index}>
                <img src={img} alt={'photo of GYM ' + index} />
              </div>
            )
          })}
        </div>
        <div className="buttons">
          <Button onClickButton={popHandle} />
          <Button />
        </div>
      </div>
    </div>
  )
}

export default Slider
